//Node Modules
import express from 'express';
import {
  json
} from 'body-parser';
import graphqlHttp from 'express-graphql';
import {
  buildSchema
} from 'graphql';
import {
  connect,
  Promise
} from 'mongoose';
import {
  Event
} from './models/eventModel';

//Custom Config
import {
  mongoURI_config
} from './config';


//Initialize express app
const app = express();

//Connect to Database
connect(mongoURI_config, {
  useNewUrlParser: true
}).then(() => {
  console.log(`Connected to ${mongoURI_config}`);
}).catch((e) => {
  throw e;
});

//Middlewares
app.use(json())

//GraphQL middleware
app.use('/graphql', graphqlHttp({
  schema: buildSchema(`
  type Event {
    _id:ID!
    title:String!
    description:String!
    price:Float!
    date:String!
  }

  input EventInput{
    title:String!,
    description:String!
    price:Float!
    date:String!  
  }

  type RootQuery {
    events : [Event!]!
  }

  type RootMutation {
    createEvent(eventInput : EventInput): Event
  }

  schema {
    query: RootQuery
    mutation: RootMutation
  }
  `),
  rootValue: {
    events: () => {
      return Event.find().then((events) => {
        return events.map(event => {
          return {
            ...event._doc
          };
        })
      }).catch((err) => {
        console.log(err);
        throw err;
      });
    },
    createEvent: (args) => {
      const event = new Event({
        title: args.eventInput.title.toString(),
        description: args.eventInput.description.toString(),
        price: +args.eventInput.price,
        date: new Date(args.eventInput.date)
      });
      return event.save().then(() => {
        return {
          ...result._doc
        };
      }).catch((err) => {
        console.log(err);
        throw err;
      });
    }
  },
  graphiql: true
}));

export default app;

